    "contracts/MetaVesting.sol": {
      "content": "// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.18;

import "./interfaces/IMetaStorageRegistry.sol";
import "./interfaces/IMetaCourtToken.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "hardhat/console.sol";

/// @title MetaVesting
/// @notice This contract is for managing token vesting schedules.
contract MetaVesting is Initializable {

    /// @notice The registry contract used for administrative functions.
    IMetaStorageRegistry registry;

    /// @notice The denominator used for percentage calculations.
    uint256 public constant DENOMINATOR = 10000;

    /// @notice A struct representing a vesting schedule.
    struct VestingSchedule {
        address account; // The address of the account that the vesting schedule is for.
        uint256 start; // The start time of the vesting schedule (TGE date).
        uint256 tgePerc; // The percentage of tokens to be released at TGE.
        uint256 cliff; // The duration from the start time until the first claim can be made.
        uint256 totalAmount; // The total amount of tokens to be vested (total_supply * supplyPerc %).
        uint256 released; // The amount of tokens that have already been claimed.
        uint256 vestingPrc; // The percentage of tokens to be released after each vesting period
        uint256 duration; // The total duration of the vesting schedule.
        uint256 period; // The duration of each vesting period.
    }

    /// @notice A mapping from addresses to their associated vesting schedules.
    mapping(address => VestingSchedule) public vestingSchedules;

    /// @notice An event that is emitted when tokens are released from a vesting schedule.
    event Released(address receiver, uint256 released);

    /// @notice Constructs a new MetaVesting contract.
    /// @param registry_ The address of the registry contract.
    constructor(address registry_) {
        require(registry_ != address(0), "MetaVesting :: Invalid registry address");
        registry = IMetaStorageRegistry(registry_);


    }

    function initVesting(uint256 tgeDate, address[7] memory _accounts) external initializer {
        require(registry.isAdmin(msg.sender), "MetaVesting :: Unauthorized");
        require(_accounts[0] != address(0) &&
        _accounts[1] != address(0) &&
        _accounts[2] != address(0) &&
        _accounts[3] != address(0) &&
        _accounts[4] != address(0) &&
        _accounts[5] != address(0) &&
        _accounts[6] != address(0), "MetaVesting :: Invalid address");

        // vesting schedule for presale
        address _presale = IMetaStorageRegistry(registry).presale();
        vestingSchedules[_presale] = VestingSchedule(_presale, tgeDate, 500, 8 * 30 days, 30000000 * 1e6, 0, 500, 570 days, 30 days);
        // vesting schedule for seed
        address _seed = IMetaStorageRegistry(registry).seed();
        vestingSchedules[_seed] = VestingSchedule(_seed, tgeDate, 1000, 4 * 30 days, 80000000 * 1e6, 0, 1000, 810 days, 90 days);
        // vesting schedule for public sale
        address _public = IMetaStorageRegistry(registry).publicSale();
        vestingSchedules[_public] = VestingSchedule(_public, tgeDate, 10000, 0, 10000000 * 1e6, 0, 0, 0, 0);

        // vesting schedule for advisors
        address advisorAcc = _accounts[0];
        vestingSchedules[advisorAcc] = VestingSchedule(advisorAcc, tgeDate, 200, 2 * 30 days, 40000000 * 1e6, 0, 250, 1170 days, 30 days);

        // vesting schedule for team
        address teamAcc = _accounts[1];
        vestingSchedules[teamAcc] = VestingSchedule(teamAcc, tgeDate, 500, 2 * 30 days, 150000000 * 1e6, 0, 1000, 810 days, 90 days);

        // vesting schedule for marketing
        address marketingAcc = _accounts[2];
        vestingSchedules[marketingAcc] = VestingSchedule(marketingAcc, tgeDate, 1000, 30 days, 50000000 * 1e6, 0, 250, 1170 days , 30 days);

        // vesting schedule for community growth
        address communityGrowthAcc = _accounts[3];
        vestingSchedules[communityGrowthAcc] = VestingSchedule(communityGrowthAcc, tgeDate, 200, 30 days, 90000000 * 1e6, 0, 200, 1470 days, 30 days);

        // vesting schedule for dao treasury
        address daoTreasuryAcc = _accounts[4];
        vestingSchedules[daoTreasuryAcc] = VestingSchedule(daoTreasuryAcc, tgeDate, 500, 2 * 30 days, 300000000 * 1e6, 0, 250, 1170 days, 30 days);

        // vesting schedule for staking rewards
        address stakingRewardsAcc = _accounts[5];
        vestingSchedules[stakingRewardsAcc] = VestingSchedule(stakingRewardsAcc, tgeDate , 500, 47 days, 150000000 * 1e6, 0, 250, 1170 days, 30 days);

        // vesting schedule for liquidity
        address liquidityAcc = _accounts[6];
        vestingSchedules[liquidityAcc] = VestingSchedule(liquidityAcc, tgeDate, 2000, 3 * 30 days, 100000000 * 1e6, 0, 1000, 420 days, 60 days);
    }

    /// @notice Releases vested tokens from the vesting schedule.
    /// @return The amount of tokens released.
    function release() external returns (uint256) {
        VestingSchedule storage vesting = vestingSchedules[msg.sender];
        require(vesting.account != address(0), "MetaVesting :: Vesting schedule does not exist");
        uint256 unclaimed = getReleasableAmount(msg.sender);
        vesting.released += unclaimed;
        IMetaCourtToken(registry.metaCourtToken()).mint(msg.sender, unclaimed);
        emit Released(msg.sender, unclaimed);
        return unclaimed;
    }

    /// @notice Calculates the amount of tokens that can be released from a vesting schedule.
    /// @param beneficiary The address of the beneficiary.
    /// @return The amount of tokens that can be released.
    function getReleasableAmount(address beneficiary) public view returns (uint256) {
        VestingSchedule memory vestingSchedule = vestingSchedules[beneficiary];
        uint256 currentTime = block.timestamp;
        uint256 released;
        if (currentTime < vestingSchedule.start || vestingSchedule.account == address(0)) {
            return 0;
        } else {
            released += vestingSchedule.totalAmount * vestingSchedule.tgePerc / DENOMINATOR;
        }
        uint256 vestedPerPeriod = ((vestingSchedule.totalAmount) * vestingSchedule.vestingPrc) / DENOMINATOR;

        uint256 elapsedTime = currentTime - vestingSchedule.start;

        if (elapsedTime >= vestingSchedule.cliff) {
            released += vestedPerPeriod;
            uint256 vestedAmount = ((elapsedTime - vestingSchedule.cliff)) / vestingSchedule.period * vestedPerPeriod;
            released += vestedAmount;
        }
        if (elapsedTime >= vestingSchedule.duration + vestingSchedule.cliff) {
            return vestingSchedule.totalAmount - vestingSchedule.released;
        }

        released -= vestingSchedule.released;
        return released;
    }

    /// @notice Returns the details of a vesting schedule for an account.
    /// @param _acc The address of the account.
    /// @return start The start time of the vesting schedule.
    /// @return tgePerc The percentage of tokens to be released at TGE.
    /// @return cliff The duration of the cliff in the vesting schedule.
    /// @return totalAmount The total amount of tokens in the vesting schedule.
    /// @return released The amount of tokens already released from the vesting schedule.
    /// @return vestingPrc The percentage of tokens to be released per vesting period.
    /// @return duration The total duration of the vesting schedule.
    /// @return period The duration of each vesting period.
    function getAccVesting(address _acc) external view returns (
        uint256 start,
        uint256 tgePerc,
        uint256 cliff,
        uint256 totalAmount,
        uint256 released,
        uint256 vestingPrc,
        uint256 duration,
        uint256 period){
        VestingSchedule memory _vesting = vestingSchedules[_acc];

        start = _vesting.start;
        tgePerc = _vesting.tgePerc;
        cliff = _vesting.cliff;
        totalAmount = _vesting.totalAmount;
        released = _vesting.released;
        vestingPrc = _vesting.vestingPrc;
        duration = _vesting.duration;
        period = _vesting.period;
    }
}
"
